  static getInitialProps() {
    console.log('get initial props')
    return {
      user: {
        name: 'Francis',
        lastName: "Medici"
      }
    }
  }
  constructor(props) {
    super(props)
    console.log('constructor');
    console.log(this.props.user);
  }
  render() {
    console.log(this.props.user)
    return (
      <>
        <MainLayout>
          <h1>Welcome to NextJS</h1>
        </MainLayout>
      </>
    );
  }
}
